import React, { Component } from 'react'
import { Provider } from 'react-redux' // 5.0.7
import 'redux' // 3.7.2

import App from './app/index'
import store from './app/store'

export default class Snack extends Component {
  render() {
    return (
      <Provider store={store}>
        <App />
      </Provider>
    )
  }
}
